        function CalculateNetPayment() {

            let totalPayment = RtnFloat($(""#totalPayment"").text());
            let vatAmount = RtnFloat($(""#VatAmount"").val());
            let taxAmount = RtnFloat($(""#IncomeTaxAmount"").val());
            if (!vatAmount) {
